import React, { Component } from 'react'
import './home.css'

export default class Home extends Component {
    constructor(props){
        super(props)
        this.state = {
            display: true, 
            autoplay: false,
        }
    }
    

render(){
    return(
        <svg className="Rectangle_14">
        <rect id="Rectangle_14" rx="10" ry="48.5" x={0} y={0} width={200} height={97}>
        </rect>
      </svg>
    )
}

}
